window.bookSummaryJSON = "<p><b>Not even the Void could hold Damien. </b></p> <p>Damien’s return to Blackmist was victorious–but it wasn’t without price. Traces of the Void linger on, interwoven through his being. He learned much in his time spent within the space beyond time, but still ended up leaving with more questions than answers. </p> <p>Henry’s former compatriots continue to advance their plans on the Mortal Plane, and Second’s power grows with every passing day. Everyone seems to have their own agenda, but the only thing Damien truly cares about is protecting himself and his friends. </p> <p>When one of those friends goes missing in Mountain Hall, one of the other Mage Colleges within the kingdom, Damien decides that he’s done being a bystander. With Void magic pumping through his veins, he’s far from the scared student that first arrived at Blackmist. </p> <p>And now, Mountain Hall is about to find out just how powerful he’s become. </p> <p><b>Book 5 in the My Best Friend is an Eldritch Horror Series. It's slice-of-life mixed with LitRPG in a magic school setting. A slow build power fantasy from Actus, the bestselling author of </b><b><i>Morcster Chef</i></b><b>.</b></p>"; 
